import styled from "styled-components";

const Chart = styled.div``;

function CustomerChart() {
  return (
    <>
      <Chart>
        <table>
          <thead>
            <th>Customer Last Name</th>
          </thead>
        </table>
      </Chart>
    </>
  );
}

export default CustomerChart;
